'use strict';(function(){const b={cache:!0};b.doc={id:'id',field:['title','content'],store:['title','href','section']};const a=FlexSearch.create('balance',b);window.bookSearchIndex=a,a.add({id:0,href:'/resources/appendices/',title:"Appendices",section:"Resources",content:"Appendices #  It is desired to make the book as self-contained as possible; therefore, additional material in the form of five online appendices are also included.\nA. Introduction to Key Biological Concepts #  B. Reconstruction of Biological Networks #  C. Databases for Systems Biology #  D. Software Tools Compendium #  E. MATLAB for Systems Biology #  "}),a.add({id:1,href:'/resources/codes/',title:"Codes",section:"Resources",content:"Codes #  The companion code repository to this book includes some key snippets of code that will enable readers to understand some of the models/methodologies described in this book.\nhttps://github.com/RamanLab/SysBioBook-Codes\nThe idea is to expand this repository over a period of time. If you think there is a piece of code that will help you better understand a concept in the book, please contribute an issue at https://github.com/RamanLab/SysBioBook-Codes/issues and I will be more than happy to include one or more code snippets to address it.\n"}),a.add({id:2,href:'/resources/lecture-videos/',title:"Lecture Videos",section:"Resources",content:"Lecture Videos #  A Massive Open Online Course on Computational Systems Biology, which is in part, a basis for this book, is also available, through the Indian educational platforms, NPTEL (National Programme on Technology Enhanced Learning) and SWAYAM.\nThe lectures (including hands-on lab sessions), totalling over 30 hours of content, are also available on YouTube.\n"}),a.add({id:3,href:'/resources/further-reading/',title:"Further Reading",section:"Resources",content:"Further Reading #  While the book contains over 700 references including special pointers to material for further reading, the following annotated reading list separated chapter-wise will be helpful in digging deeper into the concepts discussed in the text.\n"}),a.add({id:4,href:'/author-info/',title:"About the Author",section:"Home",content:"About the Author #  Karthik Raman is an Associate Professor at the Department of Biotechnology, Bhupat \u0026amp; Jyoti Mehta School of Biosciences, Indian Institute of Technology Madras. He co-founded and co-ordinates the Initiative for Biological Systems Engineering and is a core member of the Robert Bosch Centre for Data Science and Artificial Intelligence (RBCDSAI). He has been a researcher in the area of systems biology for the last 15+ years and has been teaching a course on systems biology for the last eight years, to (mostly) engineers from different backgrounds. His lab works on computational approaches to understand and manipulate biological networks, with applications in metabolic engineering and synthetic biology.\n"}),a.add({id:5,href:'/errata-feedback/',title:"Errata \u0026 Feedback",section:"Home",content:"Feedback #  Despite my best efforts and those of my colleagues and students who have carefully gone through the book, it is likely that there may be a few typographical/grammatical errors. Do send your feedback via GitHub\u0026mdash;critical feedback will be much appreciated and duly acknowledged!\nErrata #  None so far!\n"}),a.add({id:6,href:'/faq/',title:"FAQs",section:"Home",content:"Frequently Asked Questions #  What are the pre-requisites for this book?\nThe only pre-requisite for this text is a familiarity with a high-level programming language aside from an intellectual curiosity towards how mathematical and computational approaches aid in understanding biology. An engineering mathematics background will be advantageous but not strictly necessary.    "}),a.add({id:7,href:'/resources/supplementary-exercises/',title:"Supplementary Exercises",section:"Resources",content:"Supplementary Exercises #  "}),a.add({id:8,href:'/updates/',title:"Updates",section:"Home",content:"Updates #   2020-10-24: Website is up!  "}),a.add({id:9,href:'/resources/figure-slides/',title:"Figure Slides",section:"Resources",content:"Figure Slides #  Editable slides in both Powerpoint and PDF (one figure per page) formats are available freely for instructors wishing to use these in their course.\n"})})()